import React, {useState, useEffect} from 'react';


function Diagnose(){

    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )  
    }, [])


    return (
        <div>
            <h1>Diagnosis results</h1>

            {(typeof data === "undefined") ? (
                <p> Loading...</p>
            ) : (
                data.map((item, index) =>{
                    return <p key={index}>{item}</p>
                })
            )
            }
        </div>
    );
}

export default Diagnose;
